const Navbar = () => {
    return ( 
        <>
            <div className="navbar">
                <h1>React Blog Basic</h1>
                <div className="links">
                    <a href="/">Home</a>
                    <a href="/blog">Blog</a>
                    <a href="/about">About</a>
                    <a href="/contact">Contact</a>
                </div>
            </div>
        </> 
    );
}
 
export default Navbar;
